var objString = JSON.stringify(msg.payload, null, 2);

// 使用正则表达式去除注释
var cleanObjString = objString.replace(/\/\/.*/g, '').replace(/\/\*[\s\S]*?\*\//g, '');

// 将字符串转换回对象
var cleanObj = JSON.parse(cleanObjString);

function formatObject(obj) {
  for (var key in obj) {
    if (typeof obj[key] === 'number') {
      obj[key] = parseFloat(obj[key].toFixed(3));
    } else if (Array.isArray(obj[key])) {
      obj[key] = obj[key].map(function(item) {
        if (typeof item === 'number') {
          return parseFloat(item.toFixed(3));
        } else if (typeof item === 'object') {
          return formatObject(item); // 递归处理嵌套对象
        } else {
          return item;
        }
      }).join(' ');
    } else if (typeof obj[key] === 'object') {
      obj[key] = formatObject(obj[key]); // 递归处理嵌套对象
    }
  }
  return obj;
}

msg.payload=formatObject(cleanObj)
return msg;

